const { model, Schema, default: mongoose } = require('mongoose');

const UserSchema = new Schema ({
    username: {
        type: String,
    },
    email: {
        type: String,
    },
    password: {
        type: String,
    },
    createdAt: {
        type: Date,
        default: Date.now(),
    },
    profilePicture: {
        type: String,
        default: 'data:image/jpeg;base64,',
    },
    isDeleted: {
        type: Boolean,
        default: false,
    },
    role: {
        type: mongoose.Schema.Types.ObjectId,
        ref: 'Role',
        default: '63d1f400ad8c22e6816cd719',
    },
}, {
    versionKey: false
})

const User = model('User', UserSchema);

module.exports = User; 